export default function loginFormReducer(state = null, action) {
  switch (action.type) {
    case "SET_CURRENT_ACCOUNT":
    console.log(action.payload.attributes)
      return {...state.loginFormReducer, currentAccount: action.payload}
    case "CLEAR_CURRENT_ACCOUNT":
      return null 
    default:
      return state.loginFormReducer 
    };
}
